import json
import requests
import execjs
import re
import pandas as pd
from openpyxl.cell.cell import ILLEGAL_CHARACTERS_RE
import base64


# 用execjs运行七麦数据js文件，破解analysis参数
def qi_parser():
    with open('qi.js', 'r', encoding='utf-8') as f:
        myjs = f.read()
        ctx = execjs.compile(myjs)
        encrypt_data = ""
        # 参数一就是js文件里的函数，参数二就是传入从参数，返回值就是执行完函数的返回值
        new_pwd = ctx.call('my_decrypt', encrypt_data)
        new_pwd = base64.b64decode(new_pwd).decode("utf8")
        new_pwd = json.loads(new_pwd)
        print(new_pwd)



if __name__ == '__main__':

    qi_parser()





























